import React from 'react';
import './homePage.css';
import { Anchor } from 'antd';
const { Link } = Anchor;

const HomePage = () => (
  <Anchor>
    <div className="homePage">
      <h1>Todo App </h1>
      <Link to="/about"> Learn more </Link>
    </div>
  </Anchor>
);

export default HomePage;
